  '<b>Halten</b> (R&uuml;ckfrage)<br /> Wenn Sie diese Taste w&auml;hrend eines Gespr&auml;chs dr&uuml;cken, wird Ihr Gespr&auml;chspartner auf Halten gesetzt. Danach k&ouml;nnen Sie eine weitere Verbindung zu einem anderen Teilnehmer herstellen. Mit den leuchtenden Leitungstasten k&ouml;nnen Sie zwischen beiden Leitungen hin- und herschalten (Makeln).' => '<b>Hold</b> (R, consultation hold)<br /> By pressing this key during a call the other party will be put on hold. You can then establish another call to another party. You can switch back and forth between the lines using the lit line keys (consultation hold).',
  '<b>Lauth&ouml;ren</b> ein/aus' => '<b>Speaker</b> on/off',
  '<b>Lautst&auml;rke</b> des H&ouml;rers oder Lautsprechers -/+' => '<b>Volume</b> of handset or speaker -/+',
  '<b>Nicht st&ouml;ren</b> ein/aus<br /> Wenn dieser Modus aktiviert ist, werden keine Anrufe zu Ihrem Telefon durchgestellt. Dabei wird auf dem Display links unten das Symbol und &quot;Inaktiv&quot; angezeigt. Auf Ihre ggf. eingestellte Rufweiterleitung wirkt dieser Modus, als w&auml;ren Sie gar nicht eingeloggt, also offline.' => '<b>Do Not Disturb (DND)</b> mode on/off<br /> When this mode is active no calls will be connected to your phone. The phone will display the DND symbol and &quot;Inactive&quot; in the lower left corner. Your call forwarding (if configured) will act as if you were not logged in, i.e. offline.',
  '<b>Stummschaltung</b> des Mikrofons ein/aus' => '<b>Mute</b> or unmute the microphone',
  '<b>Telefonbuch</b> (Firma / pers&ouml;nlich)<br /> z.B. 63437 f&uuml;r MEIER dr&uuml;cken (&auml;hnlich &quot;T9&quot;).' => '<b>Phonebook</b> (Company / private)<br /> enter 76484 for SMITH (similar to &quot;T9&quot;).',
  '<b>Vermitteln</b><br /> Es gibt zwei Wege, wie Sie Ihren Gespr&auml;chspartner mit einer anderen Nummer verbinden k&ouml;nnen:<br /> <i>Direktes Verbinden</i>: Wenn Sie w&auml;hrend eines Gespr&auml;chs die Transfer-Taste dr&uuml;cken, wird Ihr Gespr&auml;chsparter auf Halten gesetzt. Geben Sie danach die Nummer an, mit der Sie den Anrufer verbinden m&ouml;chten. Durch Dr&uuml;cken der OK-Taste wird der Teilnehmer dann mit der gew&auml;hlten Nummer verbunden.<br /> <i>Verbinden mit R&uuml;ckfrage</i>: Dr&uuml;cken Sie hierzu w&auml;hrend eines Gespr&auml;chs die Hold-Taste um Ihren Gespr&auml;chspartner zu halten und w&auml;hlen dann die Nummer, mit der Sie ihn verbinden m&ouml;chten. Sie k&ouml;nnen jetzt mit dem zweiten Teilnehmer sprechen. Durch Dr&uuml;cken der Transfer-Taste oder durch Auflegen werden die beiden Teilnehmer verbunden.' => '<b>Transfer</b><br /> There are two different ways to transfer the other party on a call to another phone number:<br /> <i>Blind transfer</i>: If you press the Transfer key during a call the other party will be put on hold. Now enter the destination number to which you want to transfer the other party to. By pressing the OK key the other party will be transferred.<br /> <i>Attended transfer</i>: Press the Hold key during a call to put the other party on hold. Then enter the destination number to which you want to connect them to. You can now talk to the destination party. By pressing the Transfer key or by hanging up both parties will be connected.',
