  'Bitte beachten Sie, da&szlig; die Karte bei der GPBX bauartbedingt &quot;auf dem Kopf liegend&quot; eingebaut ist. Port 1 befindet sich also (von der R&uuml;ckseite betrachtet) an der rechten Geh&auml;useseite.' => 'Please note that in GPBX the card is plugged in upside down. When viewed from the back, you will find port 1 on the right side of the case.',
