  'Bitte setzen Sie ein Pa&szlig;wort um den Setup-Bereich gegen unbefugte Zugriffe zu sch&uuml;tzen. Das Pa&szlig;wort sollte mindestens 8 Zeichen lang sein und aus Buchstaben, Zahlen und Sonderzeichen wie z.B. <code>#</code>, <code>!</code> oder <code>=</code> bestehen.' => 'Please set a password to protect the Setup area against unauthorized access. The password should have a minimum length of 8 characters and should consist of alphabetic characters, digits and special characters like <code>#</code>, <code>!</code> or <code>=</code>.',
  'Bitte stellen Sie die gew&uuml;nschte IP-Adresse der GPBX ein. Geben Sie au&szlig;erdem die Netzmaske Ihres Netzwerkes sowie die Adresse Ihres Routers, Nameservers und Zeitservers an.' => 'Please enter the desired IP address of the GPBX. Please also enter the network mask of your network, as well as the IP address of your router, DNS server and time server.',
